import React from 'react'
import NavFilter from '../NavFilter/NavFilter'
import Styles from "../StyleSheet/Home.module.css"
const Home = () => {
  return (
    <div className={Styles["home-container"]}>
      <h1 className={Styles["h1-home"]}>Conoce nuestros Cursos</h1>
         <NavFilter />
    </div>
  )
}

export default Home
